    SELECT u.lang, mj.id, mj.id_parent, lr.lang_resource nome, mj.id_groups, mj.nome,  mj.branch, mj.id_page
	from lang_resources lr, menu_jportal mj , usergroups ug, users u
	WHERE (mj.id_groups = ug.id_group OR mj.id_groups = 'BASE') 
	
	AND ug.id_group = v_id_groups   
	AND u.username = v_username   
	AND mj.branch =  4
	AND ug.id_user =  u.id
	AND lr.language = u.lang AND lr.standard_lang_resource = mj.nome 
	group by mj.id 
	ORDER BY mj.col;
    
    
    SELECT u.lang, mj.id, mj.id_parent, lr.lang_resource nome, mj.id_groups, mj.nome,  mj.branch, mj.id_page
	from lang_resources lr, menu_jportal mj , usergroups ug, users u
	WHERE (mj.id_groups = ug.id_group OR mj.id_groups = 'BASE') 
	
	AND ug.id_group = v_id_groups   
