	AND g.id =  ug.id_group
	AND ug.id_user =  u.id
	AND u.username = v_username 
	AND lr.language = u.lang AND lr.standard_lang_resource = mj.nome 
    group by mj.id 
	ORDER BY mj.col;
   END IF;     
END ;;
